import React, { Component } from 'react'

import Items from '../api/controller/buscarterminos.php'

class Nav extends Component{
    render(){
        return(
            <Router>
                <nav>
                    <ul>
                        <li>
                            <Link to="/buscarterminos" className="hola">Items</Link>
                        </li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/buscarterminos" component={Items}></Route>
                </Switch>
            </Router>
        );
    }

}
export default Nav;
